import React, { useState } from 'react';
import { useSearchParams } from 'react-router-dom';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import axios from 'axios';
  
export const Dashboard = () => {
    ChartJS.register(
        CategoryScale,
        LinearScale,
        PointElement,
        LineElement,
        Title,
        Tooltip,
        Legend
    );
    
    const options = {
        responsive: true,
        plugins: {
          legend: {
            position: 'top',
          },
          title: {
            display: true,
            text: 'Chart.js Line Chart',
          },
        },
    };
    
    // const labels = ['January', 'February', 'March', 'April', 'May', 'June', 'July'];
    
    // const data = {
    //   labels,
    //   datasets: [
    //     {
    //       label: 'Dataset 1',
    //       data: [12, 21,31, 23, 16, 18,20],
    //       borderColor: 'rgb(255, 99, 132)',
    //       backgroundColor: 'rgba(255, 99, 132, 0.5)',
    //     },
    //     {
    //       label: 'Dataset 2',
    //       data: [21, 21, 20, 30, 25, 18],
    //       borderColor: 'rgb(53, 162, 235)',
    //       backgroundColor: 'rgba(53, 162, 235, 0.5)',
    //     },
    //   ],
    // };

    const [searchParams, setSearchParams] = useSearchParams();


    const getTelemetry = () => {
        const options = {
            method: "GET",
            url: `http://localhost:5000/api/v1/device/${searchParams.get("id")}/telemetry`,
            withCredentials: true
        }
        axios(options)
        .then(r => console.log(r.data))
    }

    return (
        <div className="container">
            {searchParams.get("id")}
            <button onClick={getTelemetry}>22222</button>
            {/* <Line options={options} data={data} /> */}
        </div>
    )
}
